  "resources": "HD: 1/1, Action Surge: 0/1, Second Wind: 1/1, Exhaustion: 0",
  "narrative": "Morning light filters through stained glass windows, casting prismatic colors across rows of ancient bookshelves. The Athenaeum of Whispered Tomes stretches before you‚Äîa cathedral of knowledge where forgotten secrets sleep in dust-covered volumes.\n\nYou are Aric, a scholar-turned-fighter seeking knowledge that kingdoms would kill for. The librarian, an elderly figure named Brother Aldric, regards you from behind crooked spectacles.\n\n\"You've come about the lost codex of Valdris?\" he whispers, his voice like rustling pages. \"It's here. But the basement levels... they're not safe anymore. Something stirs in the dark.\"",
  "planning_block": {
    "thinking": "The old man's eyes dart toward a spiral staircase descending into shadow. Whatever he's hiding, it's worth the risk. But he's clearly afraid‚Äîhis hands tremble around his lantern.",
